import { useState } from 'react';
import AdjectiveForm from './AdjectiveForm';
import Posts from './Posts';

function App() {

  const [run, setRun] = useState(false)


  function getData() {
    setRun(!run)
  }


  return (
    <div>
      <h1 className="text-center">Do I work?</h1>
      <AdjectiveForm getData={getData}/>
      <Posts />
    </div>
  )
}

export default App;
